import './App.css';
import { useEffect } from "react";

function App() {

  useEffect(() => {
    fetch(`http://localhost:4000/`)
      .then((response) => {
        if (!response.ok) {
          throw new Error(
            `This is an HTTP error: The status is ${response.status}`
          );
        }
        return response.json();
      })
      .then((actualData) => console.log(actualData))
      .catch((err) => {
        console.log(err.message);
      })
  }, []);

}
export default App;
